import React from "react";
import { HashRouter as Router, Route, Switch } from "react-router-dom";
import {
  Navigation,
  Home,
} from "./components";
function App() {
  return (
    <div className="App">
      <Router>
        <Navigation />
        <Switch>
          <Route path="/" exact component={() => <Home />} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
